Hey!



I would like you advice in a flow we currently have where Looker queries Snowflake.

The flow is that we have a view that is linked to a table with sql_table_name, and multiple dimensions and measurements with CASE WHEN with some basic logc. Lastly, a model that is wrapping it with a simple exposure with a simple filter.

Then, we have a php server that calls Looker API and queries that model with 6-7 filters.

This flow works well in terms of functionality, except the query generated is very complex, one that takes Snowflake up to 7 seconds to just parse.



We have escalated this to Snowflake, but i believe they will come back to us questioning about the query.



I was able to pin down the problematic dimension causing the issue (which we also pivot on):







      dimension: order_for_period {
    	    view_label: "Timeline Comparison Fields"
    	    label: "Period Order"
    	    description: "..."
    	    type: string
    	    sql:
    	       {% if current_date_range._is_filtered %}
    	         CASE
    	           WHEN {% condition current_date_range %} ${event_raw} /*findme6*/{% endcondition %}
    	           THEN 1
    	           WHEN ${event_raw} between ${period_2_start} and ${period_2_end}
    	           THEN 2
    	           WHEN ${event_raw} between ${period_3_start} and ${period_3_end}
    	           THEN 3
    	           WHEN ${event_raw} between ${period_4_start} and ${period_4_end}
    	           THEN 4
    	         END
    	       {% else %}
    	         NULL
    	       {% endif %}
    	       ;;
    	  }



where a period looks like that



      dimension: period_4_start {
    	    view_label: "_PoP"
    	    description: "Calculates the start of 4 periods ago"
    	    type: date_time
    	    sql:
    	          {% if compare_to._parameter_value == "Period" %}
    	              DATEADD(hour, -(3 * (${hours_in_period} + 1)), DATE({% date_start current_date_range %}))
    	          {% else %}
    	              DATEADD({% parameter compare_to %}, -3, DATE({% date_start current_date_range %}))
    	          {% endif %};;
    	    hidden: yes
    	    convert_tz: no
    	  }



the result is huge (attached one block of CASE it generates)



Basically what it does it creates time buckets (periods) and pivots on it.



Question is where there is a simpler implementation to it?



Thank you!

