A little further information on this, we had a prior ticket for the same issue (#113620), and in that ticket the solution given was:

    parameter: filter_value {
     type: string
     default: "default_value"
    }

    # Use the parameter in a filter
    filter: example_filter {
     field: example.field_name
     value: ${filter_value} # Use the parameter value as the filter value
    }

