    {"duration":"1.824501","sql":"WITH teams_to_entities AS (SELECT tte.*\n FROM \"PUBLIC\".\"TEAMS_TO_ENTITIES\" tte\n INNER JOIN last_teams_updates_v\n using (unique_update_id)\n )\nSELECT\n get_severity(issues.SEVERITY_SCORE) AS \"issues.severity\",\n CASE\n WHEN issues.SEVERITY_SCORE < 0 THEN 0\n WHEN issues.SEVERITY_SCORE < 6 THEN 1\n WHEN issues.SEVERITY_SCORE < 8 THEN 2\n WHEN issues.SEVERITY_SCORE < 10 THEN 3\n WHEN issues.SEVERITY_SCORE >= 10 THEN 4\n ELSE 0\n END AS \"issues.severity_order\",\n coalesce(COUNT(DISTINCT issues.\"ENTITY_ID\" ), 0) AS \"issues.count_1\"\nFROM issues AS issues\nINNER JOIN teams_to_entities ON (issues.\"UNIQUE_SNAPSHOT_ID\") = (teams_to_entities.\"UNIQUE_SNAPSHOT_ID\") and (issues.\"REALM_ID\") = (teams_to_entities.\"REALM_ID\") and issues.parent_id = (teams_to_entities.\"ENTITY_ID\") \nWHERE (issues.\"REALM_ID\" ) = 'danaher' AND (issues.\"UNIQUE_SNAPSHOT_ID\") = '42169' AND (teams_to_entities.\"TEAM_ID\" ) = 'danaher' AND (teams_to_entities.\"UNIQUE_SNAPSHOT_ID\" ) = '42169' AND ( (COALESCE(issues.confidence , 100)) >= 0.0 \n and 1678871911476000000.0 is not null \n \n and (issues.\"IS_PARENT_ARCHIVED\") = false and (issues.\"IS_ARCHIVED\") = false \n \n and issues.scan_status NOT IN ('asset-not-alive', 'asset-removed', 'issue-removed')\n \n \n )\nGROUP BY\n 1,\n 2\nORDER BY\n 2\nFETCH NEXT 50 ROWS ONLY\n-- Looker Query Context '{\"user_id\":5276,\"history_slug\":\"48ebab8c38537788418e38de427d1166\",\"instance_slug\":\"03a161054d530fade52ea9bd851109b6\"}'","h":"192-168-2-52.looker.pod.cluster.local","n":"cycognito","nid":316,"t":"2023-10-17T17:46:57.122+00:00","s":"INFO","rid":"1ed54","c":"db:*"}

