import { setFailed, ExitCode, info, error } from "@actions/core";
import { NodeSettings, NodeSession } from "@looker/sdk-node";
import { Looker40SDK } from "@looker/sdk";
import { ApiSettings, IApiSection } from "@looker/sdk-rtl";


/**
 * Looker requires you to be in Development mode when deploying.
 * This constant is the ID of the Development workspace.
 */
const LOOKER_DEV_WORKSPACE_ID = "dev";


/**
 * Deploys a LookML branch to a Looker instance
 * @param {string} project The Project ID to deploy
 * @param {string} gitRef The git reference to deploy
 * @returns {Promis<number>} 0 if successful, 1 if failed
 */
export async function deploy(project: string, gitRef: string): Promise<number> {
  let status = ExitCode.Success;


  info(
    `Starting ${project} deployment to ${process.env["LOOKERSDK_BASE_URL"]}`
  );


  const sdk: Looker40SDK = init("LOOKERSDK");


  try {
    await sdk.ok(sdk.update_session({ workspace_id: LOOKER_DEV_WORKSPACE_ID }));
    const deployResponse = await sdk.ok(
      sdk.deploy_ref_to_production({ project_id: project, ref: gitRef })
    );


    if (
      deployResponse !== undefined &&
      deployResponse !== null &&
      deployResponse == ""
    ) {
      info(
        `Completed request for deployment of ${project} to ${process.env["LOOKERSDK_BASE_URL"]} for version ${gitRef}.`
      );
    } else {
      error(
        `Failed to deploy reference: ${gitRef} for project: ${project}. Error: ${JSON.stringify(
          deployResponse
        )}`
      );
      status = ExitCode.Failure;
    }
  } catch (exception) {
    setFailed(`ERROR : ${exception}`);
    error(`ERROR : ${exception}`);
    status = ExitCode.Failure;
  }


  info(`Deployment status: ${status}`);


  return status;
}


/**
 * Initialization of the Looker SDK
 * @param {strin} prefix prefix for environment variables
 * @returns {Looker40SDK} An initialized Looker SDK instance
 */
function init(prefix: string): Looker40SDK {
  const apiSetting: ApiSettings = {
    base_url: process.env["LOOKERSDK_BASE_URL"] || "set-me",
    readConfig: readConfig,
    isConfigured: () => true,
    verify_ssl: true,
    timeout: 300,
    agentTag: "tr-looker-deploy-action",
  };


  const settings = new NodeSettings(prefix, apiSetting);
  const session = new NodeSession(settings);
  const sdk = new Looker40SDK(session);


  return sdk;
}


/**
 * Get config from the environment variables
 * @returns {IApiSection} An IApiSection object with the configuration values
 */
function readConfig(): IApiSection {
  return {
    base_url: process.env["LOOKERSDK_BASE_URL"],
    client_id: process.env["LOOKERSDK_CLIENT_ID"],
    client_secret: process.env["LOOKERSDK_CLIENT_SECRET"],
  } as IApiSection;
}

